{u'head': {u'link': [], u'vars': [u'title', u'created_at', u'has_creator', u'content', u'language']}, u'results': {u'distinct': False, u'bindings': [{u'content': {u'type': u'literal', u'value': u'Lenta pero inexorablemente, los tintos del Pened\xe9s se abren camino en el sector del consumo m\xe1s tradicional, donde s\xf3lo ten\xedan cabida sus blancos. Un sector que mayoritariamente se decanta por los vino de la denominaci\xf3n de origen Rioja, admite a rega\xf1adientes los de Ribera del Duero, accede curioso a los caldos del Priorato, y acepta como una curiosidad los Jumilla, Toro, Bierzo o Cigales. Y que menosprecia, porque ignora, la enolog\xeda tinta de Castilla-La Mancha. As\xed son, todav\xeda, las cosas.\nPor eso, el trabajo de la bodega de Sumarroca es tan encomiable como digno de apoyo. Est\xe1n desarrollando, junto a la Universidad Rovira i Virgili de Tarragona y la Universidad de Davis, en California, un estudio llamado <i>Vi\xf1as del mundo</i> con el que se pretende analizar 450 variedades de uva de las principales regiones vitivin\xedcolas del planeta.\nY aplican los resultados a vinos como este B\xf2ria, un dise\xf1o donde se prima la potencia, la fruta marcada, el roble preciso y la complejidad varietal.\nBuen vino, cosmopolita, sin fallos, pero, \xa1ay!, tambi\xe9n sin arraigo.\n'}, u'created_at': {u'type': u'literal', u'value': u'20060513'}, u'language': {u'type': u'literal', u'value': u'es'}, u'has_creator': {u'type': u'uri', u'value': u'http://webenemasuno.linkeddata.es/elviajero/resource/Account/ACCCARLOS_DELGADO'}, u'title': {u'type': u'literal', u'value': u'Un vino cosmopolita'}}], u'ordered': True}}
